import React from 'react';
import './colorcodedbar.css';

const ColorCodedBar = () => {
  // mock data
  const data = [
    { color: 'red', value: 40 },
    { color: 'blue', value: 30 },
    { color: 'green', value: 20 },
    { color: 'yellow', value: 10 },
  ];

  return (
    <div className="colorcodedbar-container" style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
      {data.map((item, index) => (
        <div key={index} style={{ backgroundColor: item.color, height: '100%', width: `${item.value}%` }} />
      ))}
    </div>
  );
};

export default ColorCodedBar;
